import logo from './logo.svg';
import React from "react";
import {Routes, Route, Link} from "react-router-dom" 
import './App.css';
import Project from './pages/Project';
import Navbar from './component/Navbar';
function App() {
  return (
    <div className="App">
      <nav>
        <Navbar/>
      </nav>
      <h1 style={{
            height: "34px",
            width: "100px",
            left: "35px",
            top: "90px",
            fontFamily: "Noto Sans",
            fontSize: "25px",
            position: "absolute",
            fontStyle: "normal",
            fontWeight:"600"
        }}>프로젝트</h1>
      <Project/>

      {/* <Link to="/">6기</Link> */}
    </div>
  );
}

export default App;
